  console.log(cart)



  return (
      <div style={panelStyle}>
          <h2>
              Shopping
          </h2>


          {cart.map((item) => (
            <p key={item.id}>{item.name} {item.price} {item.qty} </p>
          ))}
      </div>
  )
}

